import React from 'react';
import Subgenre from './Subgenre/Subgenre';
import { stringify } from 'querystring';

const SubgenreList = ({ subgenres }) => {
    
    for (const sub in subgenres) {
        if (subgenres.hasOwnProperty(sub)) {
            console.log('kid', sub);
            console.log('plz', subgenres[sub]);
            return <Subgenre
                        key={subgenres[sub].id}
                        id={subgenres[sub].id}
                        name={subgenres[sub].name}
            />
        }
    }
    
    return (
        <div>
            {
                console.log('subs', this.subgenres)
            }
        </div>
    )    
}

export default SubgenreList;
